import React from "react";
import "./index.css";

function About() {
  const navigate = useNavigate();
  const goBack = () => {
    navigate("/");
  };

  return (
    <div className="mainContainer">
      This is the About Us Page
      <button onClick={() => goBack()}>Go Back</button>
    </div>
  );
}

export default About;
